"use strict";document.querySelectorAll(".is-menu").forEach(function(e){e.addEventListener("click",function(s){e.classList.contains("is-open")?e.classList.remove("is-open"):e.classList.add("is-open")})}),document.querySelectorAll("[data-language]").forEach(function(e){e.classList.add("language-"+e.dataset.language)});